Notice.create(:id => 13, :title => "BRILLANTE!", :context => "La comisión de apoyo del SAC integrada mayoritariamente por damas sigue trabajando y aportando...\r\nInfinidad de mejoras en el predio se han hecho gracias a lo recaudado por la cantina y ahora, hemos podido comprar más equipos de comunicación, para seguir así mejorando en aspectos organizativos!\r\nAtado a esto FUAD nos a donado auriculares supresores de ruido para todos los equipos, donación que aceptamos con beneplácito y que nos deja la agradable sensación de ser recompensados en el trabajo!\r\nSeguimos mejorando, seguimos andando, con esfuerzo, trabajo y como siempre con el mismo rumbo:........darle a Salto y la región un polideportivo modelo.\r\nEl S.A.C. Avanza!", :photo_file_name => "11755202_1648764825366892_3428080966255405770_n.jpg", :photo_content_type => "image/jpeg", :photo_file_size => 17554, :photo_updated_at => Mon, 27 Jul 2015 20:49:03 UTC +00:00)
Notice.create(:id => 14, :title => "ATENCIÓN", :context => "DADO EL ATRASO EN LOS TRABAJOS Y PERMISOS CORRESPONDIENTES EN LA PISTA DE PAYSANDÚ, EL S.A.C. EN CONJUNTO CON AUTORIDADES DE PAYSANDÚ ACORDÓ REALIZAR LA FECHA DEL 8 Y 9 DE AGOSTO EN EL CIRCUITO SALTEÑO.\r\nFECHA EN PAYSANDÚ PASARÍA A SER EN LA TERCERA, DEL CAMPEONATO S.A.C.\r\nDIRECTIVA DEL SALTO AUTOMOVIL CLUB.-", :photo_file_name => "11148361_1647765438800164_3105524258180787321_o.jpg", :photo_content_type => "image/jpeg", :photo_file_size => 259821, :photo_updated_at => Mon, 27 Jul 2015 20:48:38 UTC +00:00)
